import React from "react";
import { Box, Image, VStack, HStack, Heading, Text } from "@chakra-ui/react";

import MenuBar from "./MenuBar";

import HomeBG from "./assets/home-background.svg";

function Home() {
  return (
    <>
      <MenuBar />
      <Image src={HomeBG} position="absolute" zIndex="-2" />
      <HomeContent pt="50px" />
    </>
  );
}

function HomeContent() {
  return (
    <Box>
      <VStack>
        <HStack>
          <Heading align="center" fontSize="4xl" fontWeight="light">
            Give us your time,{<br />}see your truth
          </Heading>
          <Box bg="gray.300" w="500px" h="400px"></Box>
        </HStack>
      </VStack>
    </Box>
  );
}

export default Home;
